function Saludador({ nombre, rol }) {
  const roln = rol === "g" ? "gerente" : "gerente";
  return (
    <div className="flex flex-col text-black">
      <p className=" font-medium text-base">{`Hello, ${nombre}`}</p>
      <p className="text-sm">{`${roln}`}</p>
    </div>
  );
}

export default Saludador;
